import { Injectable } from '@angular/core';
import { Subject } from 'rxjs';
import { User } from './model/user';

@Injectable()
export class userService {

  public user:any;
  
  setUser(user: User){
    this.user=user;
  }
  
  getUser(): User{
    return this.user;
  }

}
